import './App.css';
import { useState } from 'react';



export default function App() {
  return (
      <>
        <div id='main'>
          <div>
            <Square value={"X"}/>
            <Square value={"0"}/>
            <Square value={""}/>
          </div>
          <div>
            <Square value={"X"}/>
            <Square value={"0"}/>
            <Square value={""}/>
          </div>
          <div>
            <Square value={"X"}/>
            <Square value={"0"}/>
            <Square value={""}/>
          </div>
        </div>
      </>
  );
}

function Square({value}) {
    const [count , setCount]= useState(0);

    function alertSomething(){
      setCount(count + 1);
      alert(count);
    }

    return (
      <button className='Square' onClick={alertSomething}>
        {value}
      </button>

    );
  }
